    false,nt"url": null,nt"notes": "This annual narrative report for Lake Andes
    NWR, Karl Mundt NWR, and Lake Andes WMD outlines Refuge accomplishments during the
    2000 calendar year. The report begins with a summary of the year's highlights and
    weather conditions. Land acquisition is covered. The report includes a planning
    section which discusses research and investigations. Refuge administration is outlined;
    information about personnel, manpower programs, volunteer programs, funding, safety,
    and technical assistance is given. Habitat management is also covered; subjects
    include wetlands, forests, croplands, grasslands, grazing, haying, fire management,
    pest control, WPA easements, and private lands. The wildlife section of the report
    discusses endangered and threatened species, waterfowl, raptors, game mammals, fisheries
    resources, surplus animal disposal, scientific collections, marking and bird banding,
    and disease control. The public uses of the Refuge described in this report include
    outdoor classrooms, interpretive programs, fishing, trapping, wildlife observation,
    and law enforcement. The equipment and facilities section of the report provides
    information about new construction, rehabilitation, major maintenance, equipment
    replacement, and communication systems.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
